    const handleChangeData=(event)=>{
        console.log(event.target.value);
    }
    const handleChangeDate=(event)=>{
        console.log(event.target.value);
    }
  return (
    <>
      <form className="col-12 d-flex gap-2 justify-content-center">
        <input
          type="text"
          className="col-5 col-lg-4"
          placeholder="Enter your text..."
        //   value={inputData}
          onChange={handleChangeData}
        />
        <input type="Date" className="col-3 col-lg-3" 
        // value={inputDate}
        onChange={handleChangeDate}
        />
        <button type="submit" className={`col-2 col-lg-1 btn btn-outline-success  ${style.btn}`} onClick={()=>onNewItems('a','b')} >
          Add
        </button>
      </form>
    </>
  );
}
